import React, { useState } from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom
import './FuelQuoteForm.css';

const FuelQuoteForm = () => {
  const [inState, setInState] = useState(false);
  const [clientHistory, setClientHistory] = useState('');
  const [gallons, setGallons] = useState('');
  const [profitMargin, setProfitMargin] = useState('');
  const [profileComplete, setProfileComplete] = useState(false);
  const [fuelQuotes, setFuelQuotes] = useState([]);

  const handleSubmit = (e) => {
    e.preventDefault();

    const formData = {
      inState,
      clientHistory,
      gallons: parseFloat(gallons),
      profitMargin: parseFloat(profitMargin),
      profileComplete,
      fuelQuotes: fuelQuotes.map((quote) => parseFloat(quote)),
    };

    console.log(formData);
  };

  return (
    <div className="container">
      <h2>Fuel Quote Form</h2>
      <form onSubmit={handleSubmit}>
        {/* ... Your input fields ... */}
        <button type="submit">Submit</button>
      </form>

      {/* Use formData here or wherever needed */}
      {/* For example, you can display some of the formData values */}
      <div>
        <p>In State: {formData.inState.toString()}</p>
        <p>Client History: {formData.clientHistory}</p>
        {/* Add more fields as needed */}
      </div>
    </div>
  );
};

export default FuelQuoteForm;
